const axios = require("axios")

const host = process.env.REACT_APP_HOST
   // || 'https://skyscanner-skyscanner-flight-search-v1.p.rapidapi.com/apiservices/autosuggest/v1.0/UK/GBP/en-GB/?query=Stockholm'
   //  || "https://api.sproutvideo.com/v1/videos"
    // .herokuapp.com
  || "https://api.vimeo.com/oauth/authorize/client"

const secretToken = "c6dac0b0374bd8b6529c674e6d2467ea"
export default class videoService {

    static getArrayVideoService = async () => {
        const response = await axios.post(
            `${host}`,
          {
              "grant_type": "c6dac0b0374bd8b6529c674e6d2467ea",
              "scope": "public"
          },
            {
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': `bearer ${secretToken}`,
                    'Accept': 'application/vnd.vimeo.*+json;version=3.4',
                    // 'Access-Control-Request-Headers': 'sproutvideo-api-key'
                    // 'x-rapidapi-host': 'skyscanner-skyscanner-flight-search-v1.p.rapidapi.com',
                    // 'x-rapidapi-key': '2f37323723msh3e0b6c81df26c04p13a245jsn38a9cd6cb155'
                    // Client identifier: ad8e3f1947b97a05ec3e6c40ff2daee1c367901c
                    //1iu8SRoZ+zwffFyxKR6rEoTb0/ahO50cR7KrtyROLSH+hCUNn5vk227J0f1gAB2B18H35M5zfIT+mDhectkvTZtFrFEIP8Hs3BQnY8WTvx8pMVusS1DKt6wM1BmeFUWA
                },
            }
        )
        console.log(response)
        return response.data
    }
}
